import React from 'react';
import "./Home.css";
import { useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faYoutube } from '@fortawesome/free-brands-svg-icons';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';

const Home = () => {
  const navigate = useNavigate();

  const handleLoginClick = () => {
      navigate('/login'); // /login sayfasına yönlendirir.
  };

  const handleSignupClick = () => {
      navigate('/signup'); // /login sayfasına yönlendirir.
  };
  return (
    <div className='home-container'> 
      <header>
        <nav>
          <div className="top-page-content">
            <div className='logo-name'>
            <FontAwesomeIcon icon={faYoutube} style={{ marginLeft: '10px', color: 'black', fontSize: '24px' }} />
              <a href='#'>MentUp</a>
            </div>
              <div className='apply-mentorship'>
                <a href="#">Mentorluk İçin Başvur</a>
              </div>
              <div className='top-page-items'>
                <a href="#">Anasayfa</a>
                <a href="#">Hakkımızda</a>
                <a href="#">İletişim</a>
                <a href="#">Mentorlerimiz</a>
                <a href="#">Fiyatlar</a>
                <a>
                  <div className="auth-buttons">
                    <button className="login" onClick={handleLoginClick}>Giriş Yap</button>
                    <button className="register" onClick={handleSignupClick}>Kayıt Ol</button>
                  </div>
                </a>
              </div>
          </div>   
        </nav>
      </header>

      <main>
        <section className="hero">
          <h1>Mentorların tavsiyeleriyle kariyerinizi daha akıllıca büyütün</h1>
          <p>Yüzlerce farklı mentor ile sınırsız 1v1 görüntülü görüşmeleri tek bir sabit ücretli abonelik karşılığında planlayın.</p>
          <ul>
            <li>✅ Durumunuza özel kişiselleştirilmiş tavsiyeler alın</li>
            <li>✅ Kendiniz yapmanın deneme yanılma yöntemini atlayın</li>
            <li>✅ Tüm mentorlar titizlikle incelenir</li>
            <li>✅ Uygulamaya geçmeden önce fikirleri doğrulayın</li>
          </ul>
          <div className="stats">
            <p><strong>48.000+</strong> Seans rezerve edildi</p>
            <p><strong>700+</strong> Onaylanmış akıl hocası</p>
            <p><strong>4.8/5</strong> Ortalama oturum derecelendirmesi</p>
          </div>
          <div className="search-bar">
            <input type="text" placeholder="Mentor ara" />
            {/* <button>🔍</button> */}
            <button><FontAwesomeIcon icon={faMagnifyingGlass} style={{color: 'black', fontSize: '16px' }} /></button>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Home;
